import styles from "./Survey.module.css";

class Survey extends React.Component {
  state = {
    noCount: 99,
  };

  increase = () => {
    this.setState({ noCount: this.state.noCount + 1 });
  };

  render() {
    return (
      //   <div className="text-center">
      <div className={styles.surveyComponent}>
        <strong className={styles.title}>Survey</strong>
        <div>
          <div>
            <span className={styles.question}>Do you like Covid?</span>
            <span className={styles.disclaimer}>CDC Official Question</span>
          </div>
          <div>
            <span>
              <button
                className="btn btn-sm btn-primary"
                onClick={this.increase}
              >
                No
              </button>
            </span>
            <span>No Total: </span>
            <span>{this.state.noCount}</span>
          </div>
        </div>

        <div>
          <span>
            <button className="btn btn-sm btn-primary" onClick={this.increase}>
              Yes
            </button>
          </span>
          <span>Yes Total: </span>
          <span>0</span>
        </div>
      </div>
    );
  }
}

export default Survey;
